import React from 'react';
import Draggable from 'react-draggable';
import './App.css';
import hat1 from './pics/hat1.png'
import cat1 from './pics/cat1.png'
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/js/dist/carousel';

class App extends React.Component {

  render() {
    return (
      <div>
        <Draggable
          dle=".handle"
          defaaxis="both"
          hanultPosition={{x: 0, y: 0}}
          position={null}
          scale={1}
          onStart={this.handleStart}
          onDrag={this.handleDrag}
          onStop={this.handleStop}>
          <div className="box handle">
            <div className="">
              <img className="hat" src={hat1} alt="Hat"></img>
              </div>
          </div>
        </Draggable>
        {/* <div className="cat-box">
          <img className="cat" src={cat1} alt="Cat"></img>
        </div> */}
        <div id="carouselExampleControls" className="carousel slide" data-bs-ride="carousel">
        <div className="carousel-inner">
          <div className="carousel-item active">
            <img src={cat1} className="cat d-block w-100" alt="Cat"/>
          </div>
          <div className="carousel-item">
            <img src={cat1} className=" d-block w-100" alt="Cat"/>
          </div>
          <div className="carousel-item">
            <img src={cat1} className="d-block w-100" alt="Cat"/>
          </div>
        </div>
        <button className="carousel-control-prev" type="button" data-bs-target="#carouselExampleControls" data-bs-slide="prev">
          <span className="carousel-control-prev-icon" aria-hidden="true"></span>
          <span className="visually-hidden">Previous</span>
        </button>
        <button className="carousel-control-next" type="button" data-bs-target="#carouselExampleControls" data-bs-slide="next">
          <span className="carousel-control-next-icon" aria-hidden="true"></span>
          <span className="visually-hidden">Next</span>
        </button>
      </div>
      </div>
    );
  }
}

export default App;
